window.bookSummaryJSON = "<p>Magick. The irrefutable truth. Real magick lies within all of us. Dormant. Waiting for the Bold of Soul. The Fearless of Spirit. Waiting to be unleashed again. Waiting for you. Are you ready?</p> <p>Alessandria has learned things in the darkness: she would never be owned by anyone, keep your mouth shut and obey, and the lesson of retribution is a particularly nasty one. And never, ever tell anyone about the shadows.</p> <p>Then...comes the light. When five intense and breathtaking guardians invade her home, she is thrust into an insane world of immortals, witches, warriors, gods, wars of will, and wings and swords.</p> <p>And the Transition begins.</p> <p>Rising from lost child to formidable warrior, Alessandria’s power escalates but so does her dance with danger...until she is forced to face the daunting truths. She has no idea who or what she is. Someone or something is playing sick games with her life. And...she is utterly addicted to a few of these sinfully irresistible creatures.</p> <p>There’s also the small matter of the blood.</p> <p>Agonizing sacrifices must be made and lives destroyed, but the time has come for her to embrace what she’s abhorred about herself for so long and confess all of her secrets. Alessandria must choose. But how could she ever allow anyone to know what truly lurks under her skin? Be owned? And would it even matter, since she is not the only one hiding things? Explosive things...that could obliterate more worlds than her own.</p> <p>Join Alessandria in her wild, utterly sizzling excursion through life, love, and enlightenment. Tremble with her joy, torment, terror, and heat as you lose yourself in her new world. And along the way...you just might uncover the secret to true fulfillment in this scorching supernatural, paranormal romance! If you pay close attention, you will find it! Your Magick. It’s there...waiting. Are you ready?</p>"; 
